    "headlineNews": "Falcons general manager Terry Fontenot said the team understands \"we have to add quarterbacks to the roster.\u201d\n",
    "report": "",
    "analysis": "What that means is anyone's guess. The Falcons are the only team in the league with one quarterback on the roster. As of early April, Fontenot and head coach Arthur Smith were reportedly split on using the No. 4 pick on North Dakota State QB Trey Lance. What Atlanta does with its first round pick with have reverberations across the league. But if they pass on a high-end quarterback prospect with the fourth pick, the Falcons could select a signal caller in the second or third round -- someone who could sit behind Matt Ryan for a year or two before taking over the offense. A QB like Kyle Trask or Davis Mills could end up on Atlanta's roster as Ryan's 2021 backup. Trask in 2020 was first in the nation with 43 touchdown passes and second in passing yards, behind Mac Jones.\u00a0\n",
