    "headlineNews": "Tom Brady completed 32-of-50 passes for 379 yards, four touchdowns and two interceptions in the Bucs' 31-29, Week 1 win over the Cowboys.\u00a0\n",
    "report": "",
    "analysis": "It's Week 1, but tonight will go down as one of the fantasy games of the year, with both the Bucs and Cowboys simply exploding the box score. The 379 yards were Brady's third most as a Buc during the regular season, though he has now reached that mark in three of his past four games, never compiling fewer than 348 in that span. He relentlessly worked his connections with Chris Godwin, Antonio Brown and Rob Gronkowski, and could have had an even bigger night had Godwin not dropped a 46-yard touchdown on a somewhat difficult play. Neither of Brady's \"interceptions\" were his fault, with the first clanging off of Leonard Fournette's stone hands and the second coming on a first half Hail Mary. The biggest play of the night was Brady's 47-yard touchdown strike to AB in the second quarter, where AB stole Anthony Brown's soul and Brady found him along the sideline. Brady's arm looked as strong as it has his entire time in Tampa. The man is simply a freak at 44 years of age. He's going to immolate the Falcons on 10 days rest in Week 2.\u00a0\n",
