    "headlineNews": "Kyler Murray wants to run less in 2021.\u00a0\n",
    "report": "",
    "analysis": "\"Honestly, the way I see it is, my legs should be a luxury,\" Murray said. \"And it kind of wasn't like that last year. It was me having to run for us in a sense. Once my shoulder was banged up and I wasn't trying to put myself out there and take those hits, we hit a lull. Honestly, I think it was a lesson for us. We can't be one-dimensional. We've got be better in all aspects of the game.\" Murray is correct that the Cardinals' offense went into a tailspin following his injury issues. It is more debatable if his legs can become a luxury. They might have to remain a necessity considering the way they unlocked Kliff Kingsbury's attack last season. Fantasy managers shouldn't worry about it too much. Especially as he remains in his early 20s, Murray essentially has no choice but to keep running as he hunts for big plays and tries to keep defenses off-balance.\u00a0\n",
