    "headlineNews": "Tyler Huntley completed 24-of-33\u00a0passes for 285 yards and four touchdowns in the Ravens' Week 3 preseason win over Washington, adding six rushes for 14 yards and a touchdown.\u00a0\n",
    "report": "",
    "analysis": "Huntley toyed with the second and third string Washington defense through the game's final three quarters, continually challenging the secondary deep and connecting on several long balls. One of his four TD tosses was caught by rookie Tylan Wallace, who could have a role in Baltimore's offense if the team's starting wideouts don't heal up by opening day. Baltimore doesn't have to shift its offense for Huntley if he's forced to play this season -- he's a dual-threat QB who can beat defenses with his legs as well as a strong arm. Huntley should be rostered in superflex leagues in case Lamar Jackson misses more time with COVID-19.\u00a0\n",
