    "headlineNews": "Rams coach Sean McVay said Matthew Stafford won't play in the preseason.\n",
    "report": "",
    "analysis": "\"There's zero chance you'll ever see Stafford take a snap in the preseason as long as I'm the coach,\" said McVay.\u00a0\"That will never happen. Until you tell me that if a guy gets hurt in the preseason we'll get those games back, it's hard for me to make sense of it.\"\u00a0Stafford had offseason\u00a0surgery to repair a partially torn UCL in his throwing thumb\u00a0but has been\u00a0fully practicing at training camp. Resting Stafford the entire preseason is bold given he's in a new offense and hasn't played a game with any of his receivers. Preseason quarterback injuries are also rare, with\u00a0Drew Lock the only quarterback to miss time, spending the first 11\u00a0games on IR his\u00a0rookie season. The lack of preseason reps will make Stafford hard to trust for a shy-away\u00a0matchup with Chicago in Week 1.\n",
