    "headlineNews": "Baker Mayfield completed 6-of-10 passes for 113 yards and a touchdown in the Browns' third preseason game against the Falcons.\n",
    "report": "",
    "analysis": "The Browns tilted pass-heavy in Mayfield's two drives, opting for five rush attempts versus 11 passing plays. While it's difficult to take much away from a pair of preseason drives, this could point toward Kevin Stefanski letting Mayfield throw a bit more in his fourth season as a pro. If the reports of the Browns loosening the reigns on their franchise quarterback are true, Mayfield could be in for a breakout campaign. He finished 13th in touchdown rate and adjusted yards per attempt last year but lacked the volume to make a major fantasy impact. If he takes another step forward as a thrower and Cleveland inches toward league-average in passing volume, Mayfield will easily pay off his low-end QB2 ADP.\u00a0\u00a0\n",
