    "headlineNews": "Cam Newton said he was willing to be Mac Jones' backup this season.\u00a0\n",
    "report": "",
    "analysis": "In his first wide-ranging interview since being released by the Patriots, Newton said he would have \"absolutely\" been Jones' backup and mentor after the team named the rookie as their Week 1 starter. \"But listen,\" Newton said, \"the truth of the matter is this: He would have been uncomfortable.\" New England coaches may have believed the same -- that Newton's commanding presence would have put Jones in an awkward spot as he took over as the Pats' franchise quarterback. he said the Patriots did a good job in \"disguising\" their bias for Jones, saying he got two first-team reps for every ten reps Jones received. Newton said in the interview that there are not 32 QBs better than him in the NFL, signaling he won't settle for a backup gig in 2021.\u00a0\n",
