    "headlineNews": "ESPN's Adam Schefter reports QB Jameis Winston will start Week 1 against the Packers.\u00a0\n",
    "report": "",
    "analysis": "Winston shined\u00a0Monday night against Jacksonville while Taysom Hill struggled mightily, effectively ending a competition Winston was favored to win from the start. Winston taking the Saints' starting gig will allow Hill to \"fill his valuable gadget/do-everything role,\" per NFL Network's Ian Rapoport. That, of course, could be an issue for Winston's touchdown upside if head coach Sean Payton deploys Hill near the goal line. Winston, 27, becomes one of the best late-round QB selections in superflex formats. His presence under center is a boon for every pass catcher in the New Orleans offense. He'll bring far more aggressive downfield passing than we saw with Drew Brees at the helm of Payton's offense. The Saints last year threw 29 passes that traveled 20-plus yards beyond the line of scrimmage -- fewer than any team since the 2014 season. Winston can earn up to $7 million this season in incentives, mostly based on statistical markers.\u00a0\n",
