    "report": "",
    "analysis": "Chubb is arguably the best rusher in football. In 2020 Chubb led all running backs in Pro Football Focus' breakaway percentage, repeatedly delivering on his big play ability. He also\u00a0led all running backs in PFF's elusive rating, showcasing the ability to force missed tackles and pick up extra yards. Chubb also led the league\u00a0in NFL Next Gen's rush yards over expected per attempt, demonstrating an elite ability to consistently succeed on his attempts. Literally the only weakness in Chubb's game is his receiving ability. His career yards per route run is just 1.04 and last year's RB27 finish was his career high. Kareem Hunt, who is signed through 2022 will continue playing heavily on passing downs. The league's most talented one-two\u00a0punch\u00a0is now in place through for at least the next two seasons.\n",
