    "headlineNews": "Zack Moss rushed four times for 10 yards in the Bills' preseason finale against the Packers, adding a three-yard reception.\n",
    "report": "",
    "analysis": "Moss played the entire second quarter with the first-team offense, but that came after Devin Singletary played the entire first frame. It was the second week in a row where the Bills divvied up their first-team snaps with Singletary ahead of Moss. Confusing matters further, though, is that the Bills attempted zero rushes during Singletary's quarter. We would assume the duo's full-blown committee is here to stay, with Singletary the preferred option on passing downs and Moss getting the early-down advantage when Josh Allen isn't calling his own number. That will be a hard way for Moss to make a FLEX living.\u00a0\n",
