    "headlineNews": "Speaking Thursday, Rams coach Sean McVay maintained that Darrell Henderson is \"still going to have a very big role.\"\n",
    "report": "",
    "analysis": "McVay stated that the Rams trade for Sony Michel \"doesn't really change the outlook for [Henderson].\" McVay could be telling the truth here, but the problem for fantasy managers\u00a0is that it's unclear what Henderson's role was going to be even prior to the Michel trade. It's possible that Henderson was going to form a committee with another running back all along, with that running back now revealed to be\u00a0Michel. McVay's comments are still a positive sign, in the sense that Henderson only needs to maintain a large share of receiving work and to mix in and the goal line to retain significant fantasy value. As long as the Rams don't view Michel as the clear-cut starter, the explosive Henderson can still be viewed as a viable upside play in fantasy drafts.\n",
