    "headlineNews": "Jaguars placed RB\u00a0Travis Etienne on injured reserve with a Lisfranc injury, ending his season.\u00a0\n",
    "report": "",
    "analysis": "By sending Etienne to injured reserve now, the Jaguars are making him ineligible to return this season. It is the worst possible news after Etienne went down in Monday evening's smackdown preseason loss to the Saints. It further clouds Etienne's future upside after the Jags spent the summer treating him like a pure pass-catching back, though Etienne is still five months shy of his 23rd birthday. He is obviously a strong hold in Dynasty leagues, one certainly worthy of \"buy low\" offers. As for 2021 re-draft, James Robinson is now the favorite for passing-down snaps in addition to early downs, though Carlos Hyde's between-the-tackles hand is strengthened, too. Laviska Shenault is probably also due a targets boost in projections, as well.\u00a0\n",
