    "analysis": "Carolina waived RB Rodney Smith and released RB\u00a0Reggie Bonnafon to get to 53, leaving Hubbard as the clear-cut No. 2 back behind Christian McCaffrey. An All-American as a sophomore at Oklahoma State --\u00a0rushing for 2,084 yards and 21 touchdowns -- Hubbard carved out the backup role with a strong preseason in which he rushed for 139 yards on 26 carries. Hubbard displayed the burst and big-play ability he showed at Oklahoma State. He should be rostered in every 12-team league as a potential top-12 back should CMC once again struggle with injuries in 2021. The Athletic's Joe Person said there's almost no scenario where Hubbard would split backfield work with McCaffrey.\u00a0Carolina \"didn\u2019t make McCaffrey the highest-paid running back in league history to have him alternate series with Chuba Hubbard or Spencer Brown,\" he said.\u00a0\"He\u2019s going to be on the field for nearly every offensive snap when the score\u2019s close, and probably when it\u2019s not.\"\n",
