    "headlineNews": "In a now-deleted tweet, DeAndre Hopkins said the NFL's COVID-19 vaccination policy is \"making me question my future\" in the league.\u00a0\n",
    "report": "",
    "analysis": "Hopkins quickly took down the post -- one of several from NFL players unhappy about the league's new policy forcing teams to forfeit if a game can't be rescheduled following a COVID outbreak among unvaccinated players. Hopkins said the league's policy put him \"in position to hurt my team because I don't want to partake in the vaccine.\" He\u00a0posted a one-word tweet shortly thereafter: \"Freedom?\" One of the game's premiere wideouts vaguely threatening to retire instead of getting the COVID vaccine is a big deal. Hopkins certainly won't be the last player to openly discuss retirement as a protest against the NFL's pro-vaccine stance.\u00a0\n",
