    "analysis": "Robinson is currently signed to the franchise tag, worth $18 million. The stud receiver has been pushing for a new deal over the past two years but Chicago has been unwilling to pay him top dollar. Assuming no deal gets done in the final hours of the extension window, Robinson will play out 2021 on the tag and prepare to hit the open market next year. The Bears could still choose to tag him again or both parties could come to an agreement before he talks to other teams in free agency. Robinson has racked up 2,397 receiving yards over the past two seasons despite slogging through some of the league's worst quarterback play. Justin Fields has the potential to be the best quarterback Robinson has caught passes from as soon as he earns the starting nod. If Fields exceeds expectations as a rookie, Robinson's value could hit a fevered pitch heading into the 2022 offseason.\n",
