    "headlineNews": "CeeDee Lamb caught 7-of-15 targets for 104 yards and a touchdown in the Cowboys' Week 1 loss to the Bucs.\u00a0\n",
    "report": "",
    "analysis": "It was a prolific night for the sensational sophomore, but not one without mistakes. Dak Prescott's lone interception went off Lamb's fingers in tight coverage, while he also committed a few drops. His score was sensational, as he took advantage of a fake screen to run right by Bucs slot CB Sean Murphy-Bunting. Lamb was far less efficient than Amari Cooper, who hauled in 13-of-16 targets. He still offered more big-play juice, and drew almost as many looks. Attempts are not going to be in short supply in this offense, as the Cowboys' defense seems scarcely improved on last year's sorry unit. In fairness, it did have to deal with Tom Brady this evening. Both Lamb and Cooper will be in the WR1 mix for next week's date with the Chargers.\u00a0\n",
