    "headlineNews": "Seahawks signed Tyler Lockett to a four-year, $69.2 million contract extension.\u00a0\n",
    "report": "",
    "analysis": "The extension includes $37 million guaranteed. It appears the team is committed to pairing Lockett and DK Metcalf for years to come. Lockett, 29 in September, is coming off his first 100-reception season, though his yards per target and yards per catch plummeted in 2020. He has been a veritable touchdown machine over the past three seasons, racking up 28 scores since the start of the 2018 season. Lockett proved frustrating for fantasy purposes in the second half of the 2020 season, when Seattle abandoned their pass-heavy ways for an ultra-conservative approach. Fantasy's No. 1 receiver in Week 8, Lockett was fantasy 24th highest scoring wideout in the final eight weeks. He shapes up as a slightly undervalued fantasy option if the Seahawks don't seek to establish the run at all costs in 2021. That's a big if.\u00a0\n",
