    "analysis": "Harris' arrest occurred\u00a0in Maryland on July 16 at 1:27 a.m. according to police records. Although no discipline has been handed down by the league yet, these situations typically come with a two-game suspension. Harris, New Orleans' primary punt returner, was in line to open the year in the slot for Michael Thomas (ankle) prior to this news. Marquez Callaway is the next man up on special teams and will have no choice but to play alongside Tre'Quan Smith, Chris Hogan, and whomever else the Saints have available if Harris is in fact sidelined for two games. All are viable darts in re-draft leagues, but it's also possible\u00a0the Saints simply crater on offense with only Alvin Kamara available to move the ball.\n",
