    "headlineNews": "Diontae Johnson caught 11-of-16 targets for 117 yards in Pittsburgh's Wild Card beatdown from the Browns.\n",
    "report": "",
    "analysis": "Even in frustratingly leading the league in drops (10) and battling multiple injuries mid-game throughout the year, Johnson added to his resume by finishing with a team-high in targets (144) and receiving yards (923) across 15 appearances. Pittsburgh\u2019s third-round pick last season, 2020 was already Johnson\u2019s second time to lead his team in receiving in as many years. His opportunities through the air ranked eighth in the league, falling 22 shy of Stefon Diggs\u2019 NFL-leading mark (166). With JuJu Smith-Schuster set to hit the market as an unrestricted free agent, Johnson is a terrific bet to again lead the Steelers in targets across from Chase Claypool in 2021. Ben Roethlisberger\u2019s contract, which the organization could choose to part with this spring, will ultimately dictate how high Johnson should be valued in offseason fantasy drafts.\n",
