    "analysis": "A month after Henry injured his shoulder in training camp, he said he's \u201cexcited to go out there and compete with [Mac Jones]\" against Miami in the Pats' season opener. New England offensive coordinator Josh McDaniels said Henry and fellow prized free agent signing Jonnu Smith -- who was also dinged up in August -- will be ready to go for Week 1.\u00a0\u201cI feel very confident in both players\u2019 aptitude and understanding of our system and our operation and what we do offensively and what their roles are in it,\" McDaniels said. New England should be among the league leaders in two tight end sets this season, making both Henry and Smith viable fantasy options in 12 and 14-team formats. Smith on Monday said he and Henry are \"two alpha males\" pushing each other on the practice field and the weight room. Adjust your ranks.\u00a0\n",
