    "report": "",
    "analysis": "The receptions tied Gronk's high as a Buc, while the yards were his second most. Gronk and Tom Brady were putting the Cowboys' linebacker corps in a blender. Score No. 1 was a two-yarder where Gronk leaked out for an end zone grab. No. 2 was an 11-yarder where Gronk ran free against zero coverage. It could have been our imagination, but Gronk seemed to have a little more life in his legs than he did in 2020. Playing in one of the most loaded offenses\u00a0of all time, Gronk will never again approach his Patriots ceiling and consistency, but it is possible he gets in the TE1 mix.\u00a0\n",
