    "headlineNews": "Irv Smith underwent\u00a0meniscus surgery Wednesday, which is likely to end his 2021 season.\n",
    "report": "",
    "analysis": "Smith's recovery timetable is four to five months, which puts his entire 2021 season in doubt. Behind Smith, backup Tyler Conklin has recovered from his hamstring injury and set to play in Week 1. Conklin has a career yards per route run of just 1.0, and is unlikely to deliver a strong fantasy season unless he monopolizes tight end snaps. Conklin's chances of doing that took a big hit when the Vikings traded for Chris Herndon Tuesday. The\u00a0former Jet looked like an emerging star as a rookie in 2018. He was then abysmal in his two seasons under Adam Gase, as is customary. If Herndon can recapture his early career form, the pass-catching tight end could be improbably fantasy relevant this season.\n",
