    "headlineNews": "USA\u00a0Today's Charles McDonald said he expects the 2021 Falcons to \"be much more pass-heavy\" than the 2020 Titans offense coached by Arthur Smith.\u00a0\n",
    "report": "",
    "analysis": "Smith, of course, is entering his first year as Atlanta's head coach after coordinating Tennessee's offense for two seasons. The lack of a dominant rusher like Derrick Henry was always going to factor in to how Smith runs the Falcons offense. McDonald said the addition of phenom TE Kyle Pitts could lead to more two-tight end sets for Atlanta after Smith's Titans were fourth in the number of drop backs with two tight ends on the field in 2020. That would mean incumbent tight end Hayden Hurst could still play significant snaps, though it's unlikely he'll get anywhere close to the 88 targets he saw last year. Smith, McDonald said, would likely change the way the tight end operates in his offense after using Jonnu Smith on short routes in Tennessee. McDonald expects Pitts to be used as more of a seam buster who can take advantage of single coverage from secondaries grappling with the Falcons' dangerous pass catchers. Already the fourth tight end off the draft board, Pitts could have a head-spinning ADP by August.\u00a0\n",
