    "headlineNews": "Jordan Akins is one of two pass-catching tight ends on the Texans roster.\u00a0\n",
    "report": "",
    "analysis": "The Texans -- who inexplicably kept five running backs -- ended up with three tight ends after this week's roster cut-downs: Akins,\u00a0Pharaoh Brown, and fifth-round rookie Brevin Jordan. The Athletic's Aaron Reiss said Akins and Brown are the team's only pass-catching tight ends going into 2021. Akins, the team's starting tight end for much of 2020, could see significant playing time in Houston's offense this season. Akins last season had a respectable per-game average of 22.9 pass routes and 3.8 targets. The loss of red zone target TE Darren Fells could open up more high-value targets for Akins, who had 14 receptions for 162 yards and a touchdown in the 2020 season's first four weeks before missing time with a concussion.\u00a0The Texans being forced into pass-heavy game scripts could make Akins a decent option in deeper formats this season.\n",
